import './App.css';
import ResponsiveAppBar from './components/AppBar';
import IntroBox from './components/IntroBox';
import ProjectsBox from './components/ProjectsBox';

function App() {
  return (
    <div className="App">
      <ResponsiveAppBar />
      <div className='mx-auto container'>
        <section style={{justifyContent: "space-between", alignItems: "center", pb: 20}}>
          <IntroBox />
        </section>
        <section>
        <ProjectsBox />
        </section>

      </div>


    </div>
  );
}

export default App;
